    const {title, date, description} = item;
    return (
      <div className="choiceContainer">
        <h1>{title}</h1>
        <h3>Date: </h3>
        <h3>Time: </h3>
        <h3>Place: </h3>
        <Link to="/"><button>Choose</button></Link>
        </div>
    );
  }
export default StatusColumn;
